import React, { Component } from 'react'

export default class LandingPage extends Component {
    render() {
        return (
            <div>
                <h1>LandingPage</h1>
                {this.props.homeList.map((home)=> {
                    return(
                        <h2>{home}</h2>
                    )
                })}
            </div>
        )
    }
}
